import React from 'react';
import img1 from './Images/img1.png';
const Home = ()=>{
    return(
        <>
        <br/>
        <br/>
        <br/>
       <div className='main-div align-items-center justify-content-center'>
        <div className="container align-items-center justify-content-center ">
            <h1 className='text-center'>Vishruti Agrawal</h1>
            <img src={img1} alt='img1..' className="ban-img align-items-center justify-content-center"/>
        </div>
        <div className=' justify-content-center align-items-center'>
            <p className='Ptext'>I am a Web Designer and Developer. I love to Design and develope new web projects for the people.</p>
            
        </div>
       <div className='align-items-center mx-auto'>
       <button className='btn btn-primary '>See My Work</button>
       </div>

       </div>
        
        </>
    );
};
export default Home;
